#!/usr/bin/perl

# Smallest weak pseudoprime to all natural bases up to prime(n) that is not a Carmichael number.
# https://oeis.org/A285549

# Version with terms > 2^64.

use 5.020;
use strict;
use warnings;

use Storable;
use Math::GMPz;
use ntheory qw(:all);
use Math::Prime::Util::GMP;
use experimental qw(signatures);

# Make sure the storable file includes all the Carmichael numbers from factor.db
my $carmichael_file = "cache/factors-carmichael.storable";
my $carmichael = retrieve($carmichael_file);

eval { require GDBM_File };

my $cache_db = "cache/factors.db";

dbmopen(my %db, $cache_db, 0444)
  or die "Can't create/access database <<$cache_db>>: $!";

sub check ($n) {

    my $count = 0;
    for (my $base = 3; ; $base = next_prime($base)) {
        ++$count;
        Math::Prime::Util::GMP::is_pseudoprime($n, $base)
            or return $count;
    }

    return undef;
}

my @table = ();
my $z = Math::GMPz::Rmpz_init();

while (my ($n, $value) = each %db) {

    next if exists $carmichael->{$n};
    Math::Prime::Util::GMP::is_pseudoprime($n, 83, 2) || next;      # 83 = prime(23)

    my $v = check($n);

    next if ($v <= 22);

    if (not defined $table[$v]) {
        $table[$v] = Math::GMPz->new($n);
        say "a($v) <= $n";
    }
    else {

        Math::GMPz::Rmpz_set_str($z, $n, 10);

        if ($z < $table[$v]) {
            $table[$v] = Math::GMPz->new($n);
            say "a($v) <= $n";
        }
    }
}

dbmclose(%db);

say "\nFinal results:";

foreach my $i (0..$#table) {
    if (defined($table[$i])) {
        printf("a(%2d) <= %s\n", $i, $table[$i]);
    }
}

__END__
